module.exports = "<div class=\"row text-center\">\n\n  <div class=\"col-12 col-sm-12 col-md-12 col-lg-12\">\n\n    <article>\n\n      <img src=\"assets/images/i_avatar.jpg\" class=\"img-fluid mb-5\" style=\"height:200px;\">\n      <p class=\"text-justify\">\n        I am Aditya Dave. Your software engineer next door. An aspiring computer scientist, and a budding freelancer. Driven by passion\n        for building immersive experiences using the power of technology. Building solutions for varied businesses and see\n        them grow, is one of the things that makes me wonder on the power of technology. I believe in putting emphasis on\n        great design and the best of technology, to make the ends meet.\n      </p>\n      <p class=\"text-justify\">\n        Being part of two major projects during my undergrad, and completing them above my own satisfaction level has made me a confident\n        team player. It also helped in developing good negotiating and leadership skills. Getting involved in the projects\n        from start to end, has made me aware about the typical development process an application goes through and most of\n        the common loopholes to avoid.\n      </p>\n      <p class=\"text-justify\">\n        Besides technology, I love reading books. In my free time you can find me fiddling with code at various places like codeforces,\n        hackerrank and hackerearth.\n      </p>\n      <p class=\"text-justify\">\n        Having a clear vision of the requirements and coming up with ideas out of the box are what I feel the most important aspects\n        of a successful freelance developer. Want to discuss your project or need some suggestions? Click here to contact\n        me.\n      </p>\n      <p class=\"text-justify\">\n        Interested in contributing code? Find a project that interests you from my github or bitbucket profile shown below.\n      </p>\n\n    </article>\n\n    <!-- Social Links Row Start-->\n    <div class=\"row\">\n\n      <div class=\"col-12 col-sm-12 col-md-12 col-lg-12\">\n\n        <!-- Social Links Container Start -->\n        <app-social-links [socialData]=\"this.details\"></app-social-links>\n        <!-- Social Links Container Start -->\n\n      </div>\n\n    </div>\n    <!-- Social Links Row End-->\n\n  </div>\n</div>\n"

